import React, {Component} from 'react'
import Typography from "@material-ui/core/Typography";
import {withRouter} from "react-router-dom";
import CompositionList from "./CompositionList";
import {connect} from "react-redux";
import SecondaryLayout from "../_layouts/default/SecondaryLayout";
import Container from "@material-ui/core/Container";
import styled from "styled-components";

const PageCaptionSpacer = styled.div`
    padding: ${({theme}) => theme.spacing(2, 0, 2)};
`

class CompositionsContainer extends Component {

    constructor(props) {
        super(props)
        this.state = {
            compositions: props.compositions,
        }
    }

    render() {
        return (
            <SecondaryLayout>
                <PageCaptionSpacer>
                    <Container maxWidth="md">
                        <Typography component="h1" variant="h5" align="left" color="textPrimary">
                            Листинг композиций
                        </Typography>
                    </Container>
                </PageCaptionSpacer>
                <CompositionList compositions={this.state.compositions}/>
            </SecondaryLayout>
        )
    }
}

const mapStateToProps = (store) => ({
    compositions: store.compositionsPage.compositions
})

export default connect(mapStateToProps)(withRouter(CompositionsContainer))
